// SPDX-License-Identifier: MIT
pragma solidity ^0.4.22;

contract CalledContract {
    event CallEvent(address sender, address origin, address from);

    function calledFunction() public {
        emit CallEvent(msg.sender, tx.origin, this);
    }
}

library CalledLib {
    event CallEvent(address sender, address origin, address  from);

    function calledFunction() public {
        emit CallEvent(msg.sender, tx.origin, this);
    }
}

contract Caller {
    function makeCalls(CalledContract _contract) public {
        _contract.calledFunction();
        CalledLib.calledFunction();

        require(address(_contract).call(bytes4(keccak256("calledFunction()"))));
        require(address(_contract).delegatecall(bytes4(keccak256("calledFunction()"))));
    }
}
